func TestSignMessage(t *testing.T) {
	priKey := "1790962db820729606cd7b255ace1ac5ebb129ac8e9b2d8534d022194ab25b37"
	message := "APTOS\naddress: 0xcb95e54bf4baa46bfc6748ef979edca6199a923df3d0757d896a7dc93514a19b\napplication: dapp\nchainId: 1\nmessage: Welcome to dApp!\nnonce: 9999"
	signature, err := SignMessage(priKey, message)
	require.NoError(t, err)
	expected := "0x839a6d2be81419ab46d4379f7fe56a62afe592fe1f7c7fbad5b34fdc27614f76341446021bf862a3e13a7ab37dadd43909fe6af9ad0c92af2973a2207583a401"
	require.Equal(t, expected, signature)
	pubKey, err := ed25519.PublicKeyFromSeed(priKey)
	require.NoError(t, err)
	signB, err := hex.DecodeString(signature[2:])
	require.NoError(t, err)
	ok := cryptoed25519.Verify(pubKey, []byte(message), signB)
	require.True(t, ok)
}
